import "./App.scss";
import { Navbar, getNavItems, Main } from "../components";



function Header() {
  return (
    <header>
      <h1>Portfolio Site</h1>
      <h4>This is my portfolio site</h4>
    </header>
  );
}

function Footer() {
  return <footer>Copyright &copy; 2020</footer>;
}

function App() {
  return (
    <div className="App">
      <Header />
      <Navbar navItems={getNavItems()} />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
